(828, 7467, 0, 120, 0, 1, '[{\"head\":1, \"body\":1, \"leg\":1, \"bag\":-1}]', 'Thẻ Khủng long', 'Hai chi trước của Khủng long rất ngắn nên chúng không thể cầm thức ăn được', '[{\"id\": 50, \"param\": 1, \"activeCard\": 0},\n{\"id\": 50, \"param\": 2, \"activeCard\": 1},\n{\"id\": 50, \"param\": 3, \"activeCard\": 2}]', -1, 0, -1),
(829, 7468, 0, 120, 0, 2, '[{\"head\":1, \"body\":1, \"leg\":1, \"bag\":-1}]', 'Thẻ Lợn lòi', 'Lợn lòi có sở thích mài răng nanh dưới đất, vô tình tạo ra những rãnh đất để người Namec trồng trọt', '[{\"id\":77,\"param\":1,\"activeCard\":0},{\"id\":77,\"param\":2,\"activeCard\":1},{\"id\":77,\"param\":3,\"activeCard\":2}]', 828, 2, -1),
(830, 7469, 0, 120, 0, 3, '[{\"head\":1, \"body\":1, \"leg\":1, \"bag\":-1}]', 'Thẻ Quỷ đất', 'Bản tính của Qủy đất khá nhút nhát, chúng thường núp vào cây khi gặp người lạ', '[{\"id\":103,\"param\":1,\"activeCard\":0},{\"id\":103,\"param\":2,\"activeCard\":1},{\"id\":103,\"param\":3,\"activeCard\":2}]', 829, 2, -1),
(831, 7470, 1, 120, 0, 4, '[{\"head\":1, \"body\":1, \"leg\":1, \"bag\":-1}]', 'Thẻ Khủng long mẹ', 'Hai chi trước của Khủng long rất ngắn nên chúng không thể cầm thức ăn được', '[{\"id\": 94, \"param\": 1, \"activeCard\": 0}, {\"id\": 94, \"param\": 2, \"activeCard\": 1}, {\"id\": 94, \"param\": 3, \"activeCard\": 2}]', 830, 2, -1),
(832, 7471, 1, 120, 0, 5, '[{\"head\":1, \"body\":1, \"leg\":1, \"bag\":-1}]', 'Thẻ Lợn lòi mẹ', 'Lợn lòi có sở thích mài răng nanh dưới đất, vô tình tạo ra những rãnh đất để người Namec trồng trọt', '[{\"id\": 14, \"param\": 1, \"activeCard\": 0}, {\"id\": 14, \"param\": 2, \"activeCard\": 1}, {\"id\": 14, \"param\": 3, \"activeCard\": 2}]', 831, 2, -1),
(833, 7472, 1, 120, 0, 6, '[{\"head\":1, \"body\":1, \"leg\":1, \"bag\":-1}]', 'Thẻ Quỷ đất mẹ', ' Bản tính của Qủy đất khá nhút nhát, chúng thường núp vào cây khi gặp người lạ', '[{\"id\": 50, \"param\": 3, \"activeCard\": 0},\n{\"id\": 50, \"param\": 4, \"activeCard\": 1},\n{\"id\": 50, \"param\": 5, \"activeCard\": 2}]', 832, 2, 1),
(834, 7473, 2, 120, 0, 7, '[{\"head\":1, \"body\":1, \"leg\":1, \"bag\":-1}]', 'Thẻ Thằn lằn bay', 'Thằn lằn bay dùng cái mỏ dài và cứng để tấn công kẻ thù, đôi khi chúng vẫn dùng để gõ hạt óc chó ăn', '[{\"id\":77,\"param\":3,\"activeCard\":0},{\"id\":77,\"param\":4,\"activeCard\":1},{\"id\":77,\"param\":5,\"activeCard\":2}]', 833, 2, -1),
(835, 7474, 2, 120, 0, 8, '[{\"head\":1, \"body\":1, \"leg\":1, \"bag\":-1}]', 'Thẻ Phi long', 'Dùng tốc độ cực nhanh để tiếp cận và hạ gục mục tiêu, Phi long cũng có sở thích hơi lạ là khi bay luôn mở to miệng để đón gió', '[{\"id\":103,\"param\":3,\"activeCard\":0},{\"id\":103,\"param\":4,\"activeCard\":1},{\"id\":103,\"param\":5,\"activeCard\":2}]', 834, 2, -1),
(836, 7475, 2, 120, 0, 9, '[{\"head\":1, \"body\":1, \"leg\":1, \"bag\":-1}]', 'Thẻ Quỷ bay', 'Sở trường tấn công chớp choáng kẻ thù, nhưng đâu ai ngờ Quỷ bay lại có bệnh sợ độ cao', '[{\"id\": 94, \"param\":3, \"activeCard\": 0}, {\"id\": 94, \"param\": 4, \"activeCard\": 1}, {\"id\": 94, \"param\": 5, \"activeCard\": 2}]', 835, 2, -1),
(837, 7476, 3, 120, 0, 34, '[{\"head\":1, \"body\":1, \"leg\":1, \"bag\":-1}]', 'Thẻ Lính độc nhãn', 'Người ta nuôi quân lính dùng trong 1 giờ, Lính độc nhãn thì không dùng được 5 phút', '[{\"id\": 7, \"param\":30, \"activeCard\": 0}, {\"id\": 0, \"param\": 5, \"activeCard\": 1}, {\"id\": 6, \"param\": 50, \"activeCard\": 2}]', 836, 2, -1),
(838, 11048, 3, 120, 1, 18, '[{\"head\":1219, \"body\":1220, \"leg\":1221, \"bag\":64}]', 'Thẻ Rồng Thần Namec', 'Mẹ thề làm con này lâu vãi nồn', '[{\"id\": 50, \"param\": 10, \"activeCard\": 0},\n{\"id\": 50, \"param\": 20, \"activeCard\": 1},\n{\"id\": 50, \"param\": 20, \"activeCard\": 2}]', 837, 2, 1);
